//: Playground - noun: a place where people can play

import UIKit

class Solution {
    func strStr(_ haystack: String, _ needle: String) -> Int {
        if haystack == needle {
            return 0
        }
        var index = 0
        let haystackChar = [Character](haystack.characters)
        let needleChar = [Character](needle.characters)
        //此处为重点
        while index <= haystackChar.count - needleChar.count {
            var isAll = true
            for i in 0..<needleChar.count {
                if index + i >= haystackChar.count || haystackChar[index + i] != needleChar[i] {
                    isAll = false
                    break
                }
            }
            if isAll == true {
                return index
            }
            index = index + 1
        }
        return -1
    }
}
print(Solution().strStr("", "aa" ))

print(Solution().strStr("", ""))
